import React from 'react';
 import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';



 function App() {
     return (
       <UserProvider>
         <Router>
           <Routes>
             <Route path='/' element={<restaurant/>}/>
           </Routes>
        </Router>
       </UserProvider>
     );
   }

   export default App;
